import React, { useState, useEffect } from 'react';
import { Link, useLocation } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import './Navigation.css';

const Navigation = () => {
  const { isAuthenticated, isAdmin } = useAuth();
  const [isMenuVisible, setIsMenuVisible] = useState(true);
  const [isCollapsed, setIsCollapsed] = useState(false);
  const location = useLocation();

  // Обработка скролла
  useEffect(() => {
    let lastScrollY = window.scrollY;
    
    const handleScroll = () => {
      const currentScrollY = window.scrollY;
      
      // Показываем меню при скролле вверх или в самом верху страницы
      if (currentScrollY < lastScrollY || currentScrollY < 50) {
        setIsMenuVisible(true);
      } else {
        setIsMenuVisible(false);
      }
      
      lastScrollY = currentScrollY;
    };

    window.addEventListener('scroll', handleScroll, { passive: true });
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const toggleMenu = () => {
    setIsCollapsed(!isCollapsed);
  };

  return (
    <nav className={`navigation ${!isMenuVisible ? 'hidden' : ''} ${isCollapsed ? 'collapsed' : ''}`}>
      <div className="nav-content">
        <div className="nav-left">
          <button className="menu-toggle" onClick={toggleMenu}>
            {isCollapsed ? (
              <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path d="M4 18H20M4 12H20M4 6H20" stroke="currentColor" strokeWidth="2" strokeLinecap="round"/>
              </svg>
            ) : (
              <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path d="M6 18L18 6M6 6L18 18" stroke="currentColor" strokeWidth="2" strokeLinecap="round"/>
              </svg>
            )}
          </button>
          <Link to="/" className="nav-brand">
            Сайт знакомств
          </Link>
        </div>

        <div className="nav-links">
          <Link to="/profiles" className={location.pathname === '/profiles' ? 'active' : ''}>
            Анкеты
          </Link>
          <Link to="/search" className={location.pathname === '/search' ? 'active' : ''}>
            Поиск
          </Link>
          {!isAuthenticated ? (
            <div className="auth-buttons">
              <Link to="/login" className={`login-button ${location.pathname === '/login' ? 'active' : ''}`}>
                Вход для рекламодателей
              </Link>
            </div>
          ) : (
            <>
              {isAdmin && (
                <div className="admin-buttons">
                  <Link to="/admin/profiles" className={location.pathname === '/admin/profiles' ? 'active' : ''}>
                    Управление анкетами
                  </Link>
                  <Link to="/admin/cities" className={location.pathname === '/admin/cities' ? 'active' : ''}>
                    Управление городами
                  </Link>
                  <Link to="/admin/create" className={location.pathname === '/admin/create' ? 'active' : ''}>
                    Создать анкету
                  </Link>
                  <Link to="/admin/settings" className={location.pathname === '/admin/settings' ? 'active' : ''}>
                    Настройки сайта
                  </Link>
                </div>
              )}
              <Link to="/cabinet" className={location.pathname === '/cabinet' ? 'active' : ''}>
                Кабинет
              </Link>
            </>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navigation;
